__NUXT_JSONP__("/fauna/slidak-tatarsky", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o){return {data:[{fauna:[{id:h,id_image_cover:f,id_image_hero:f,ids_states:[{id:i}],created_at:"2023-05-28T21:13:24.952707+00:00",slug:j,name:"Slíďák tatarský",description:"Tento pavouk je známý svým agresivním chováním a jedovatostí. Má hnědou barvu a dorůstá délky až 2 cm. Jeho kousnutí je bolestivé a může způsobit podráždění, otok a alergické reakce.",location:b,status_iucn:b,status_danger:"danger",name_lat:"Lycosa singoriensis"}],imageFauna:[{id:f,name:j,source:"\u002Ffauna\u002F",date_create:"2023-05-29T10:17:53.693157+00:00",type:"fauna",author:k}],placesStates:[{id:i,tld:".ma",name:"Maroko",area:446550,population:37252824,slug:l,id_continent:d,information_chatgpt:"\u003Cp\u003EMaroko je severoafrický stát, který se nachází na pobřeží Atlantského oceánu a Středozemního moře. Má rozlohu 446 550 km² a v roce 2021 zde žilo přibližně 37,8 milionu lidí. Hlavním městem je Rabat.\u003C\u002Fp\u003E\n\u003Cp\u003EMaroko je známé svými rozmanitými krajinami, jako jsou pouště, hory, pláže a oázy. Nejvyšší horou je Toubkal s nadmořskou výškou 4 167 metrů. Mezi nejpopulárnější turistické destinace patří města Marrákeš, Fés a Essaouira, ale také pouštní město Merzouga, kde si turisté mohou vychutnat jízdu na velbloudovi a pozorovat západ slunce v poušti.\u003C\u002Fp\u003E\n\u003Cp\u003EMaroko má také bohatou kulturu a historii, která sahá až do antických dob. V zemi se nachází mnoho historických památek, jako jsou medíny, mešity a paláce, z nichž mnohé jsou zapsány na seznamu UNESCO.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě toho je Maroko také známé svou kuchyní, ve které se často používají koření, jako je koriandr, kmín a kurkuma. Mezi nejznámější marocká jídla patří tagine, harira a couscous.\u003C\u002Fp\u003E\n\u003Cp\u003EV Maroku se také nachází mnoho přírodních parků a rezervací, které slouží k ochraně místních druhů rostlin a živočichů, jako jsou například opice berberské, pštrosi a gazely. \u003C\u002Fp\u003E",currency_code:"MAD",currency_name:"marocký dirham",money_prices:[{name:"Taxi (cena za km)",value:m,date_update:a},{name:"Hlavní jídlo",value:70,date_update:a},{name:"Chleba",value:h,date_update:a},{name:"Mléko",value:6,date_update:a},{name:"Voda (500ml)",value:3,date_update:a},{name:"Espresso",value:10,date_update:a},{name:"Zmrzlina (jeden kopeček)",value:d,date_update:a},{name:"Pivo",value:20,date_update:a},{name:"Krabička cigaret",value:b,date_update:a},{name:"Big Mac",value:b,date_update:a},{name:"Coca Cola (500ml)",value:d,date_update:a}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:e},{name:"Policie",value:"19",date_update:e},{name:"Hasiči",value:n,date_update:e},{name:"Zdravotnická záchranná služba",value:n,date_update:e}],phone_prefix:"+212",coordinates:[{latitude:"31.7917",longitude:"-7.0926"}],people_religion:[{name:"Islám",value:"99 %"},{name:"Jiné náboženství",value:"1 %"}],people_nationality:[{name:"Arabové",value:"80 %"},{name:"Berbeři",value:"20 %"}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup do Maroka jako občan EU není občanský průkaz platným dokladem totožnosti. Je nutné mít platný cestovní pas.",date_update:c},{name:"Cestovní pas",value:"Pro vstup do Maroka je nutné mít platný cestovní pas, který musí být platný minimálně po dobu celého pobytu. Délka povoleného pobytu je 90 dnů.",date_update:c},{name:"Vízum",value:"Pro občany České republiky není nutné vízum pro krátkodobý pobyt (do 90 dnů) v Maroku. Pokud však plánujete dlouhodobý pobyt, je nutné získat vízum předem na marockém velvyslanectví.",date_update:c},{name:"Očkování",value:"Pro vstup do Maroka není vyžadováno žádné specifické očkování. Nicméně, je doporučeno očkování proti hepatitidě A a B, žluté zimnici a břišnímu tyfu. Důležité je také mít platné očkování proti běžným nemocem, jako jsou tetanus, spála, zarděnky a chřipka.",date_update:c},{name:"Cestovní pojištění",value:"Pro vstup do Maroka není povinné mít cestovní pojištění, ale je silně doporučováno. V případě potřeby lékařské péče mohou být náklady velmi vysoké, a tak by mít pojištění mohlo ušetřit cestovatelům mnoho finančních problémů.",date_update:c},{name:"Bezpečností situace",value:"Maroko je obecně bezpečnou zemí pro turisty, ale je důležité být obezřetný a dodržovat základní bezpečnostní opatření, zejména v turistických oblastech. Zvláštní opatrnost se doporučuje v okolí hranic s Alžírskem a Západní Saharou, kde jsou možné bezpečnostní rizika v důsledku separatistických skupin a teroristických hrozeb.",date_update:c},{name:"Další informace",value:"V Maroku je dobrým zvykem vyjednávat o cenách u místních prodejců, a to zejména na trzích a v obchodech s turistickými suvenýry. Dále je nutné být obezřetný ohledně pitné vody a konzumovat pouze balenou vodu. V Maroku je možné platit hotovostí i platebními kartami, ale je třeba mít na paměti, že v menších městech a obcích nejsou všechny obchody vybaveny platebními terminály.",date_update:c}],type_place:o,id_image_cover:g,id_image_hero:g,id_city_main:1339,affiliate:[{name:"booking",value:true}],mpz:"MA",alerts:b,zoom:[{google:d,booking:m}],ids_neighboring_countries:[{id:62},{id:66}],organization:b,apps:b,links:b}],imagesStates:[{id:g,name:l,source:"\u002Fworld\u002Fstates\u002F",date_create:"2023-05-03T20:14:00.749527+00:00",type:o,author:k}]}],fetch:{},mutations:void 0}}("01-2021",null,"09-2021",5,"05-2023",507,312,2,137,"slidak-tatarsky","pixabay.com","maroko",7,"15","state")));